import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Components/Home.js';
import LoginRegisterOptions from './Components/LoginRegisterOptions';
import StudentRegister from './Components/StudentRegister'; 
import FacultyRegister from './Components/FacultyRegister'; 
import SecurityRegister from './Components/SecurityRegister'; 
import StudentLogin from './Components/StudentLogin.js';
import './App.css';
import './styles/StudentRegister.css';

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route Component={Home} path='/'/>
          <Route Component={StudentRegister} path='/StudentRegister'/>
          <Route Component={StudentLogin} path='/StudentLogin'/> 
          {/* <Route Component={StudentPage} path='/StudentPage'/> */}

          <Route Component={FacultyRegister} path='/FacultyRegister'/>
          {/* <Route Component={FacultyLogin} path='/FacultyLogin'/>
          <Route Component={FacultyPage} path='/Faculty'/> */}

          <Route Component={SecurityRegister} path='/SecurityRegister'/>
          {/* <Route Component={SecurityLogin} path='/SecurityLogin'/>
          <Route Component={SecurityPage} path='/Secuirty'/>
           */}
        </Routes>
      </Router>
    </>
  );
}

export default App;
